const bubbleStyles = {
  greenFilled: {
    color: '#fff',
    borderColor: '#32955c',
    backgroundColor: '#3eb777',
  },
  greenBorderOnly: {
    color: '32955c',
    borderColor: '#32955c',
    backgrounColor: '#fff',
  },
  redFilled: {
    color: '#fff',
    borderColor: '#ad1e3e',
    backgroundColor: '#db1d41',
  },
}

export default bubbleStyles;
